event_name:
=IFERROR(
  INDEX(
    INDIRECT("'events'" & "!" & SUBSTITUTE(ADDRESS(1, MATCH("name", events!$1:$1, 0), 4), 1, "") & ":" & SUBSTITUTE(ADDRESS(1, MATCH("name", events!$1:$1, 0), 4), 1, "")),
    MATCH(
      INDEX(
        2:2,
        MATCH("event_id", $1:$1, 0)
      ),
      INDIRECT("'events'" & "!" & SUBSTITUTE(ADDRESS(1, MATCH("id", events!$1:$1, 0), 4), 1, "") & ":" & SUBSTITUTE(ADDRESS(1, MATCH("id", events!$1:$1, 0), 4), 1, "")),
      0
    ) 
  )
)

